import './App.css';

function App() {
  return (
    <div>
      <MainTitle label="Bitcoin Miner ⛏" />
      <div classprop="raw-block">
        <MainText label="Enter your name" />
        <BoldText label="Bold text" />
      </div>

      <AccentText label="accent text here" />
    </div>
  );
}

export default App;
